// src/pages/Home.js
import React from 'react';
import banner from '../banner.jpg';

function products() {
    return (
        <div className="banner">
            <img src={banner} alt="Banner" />
            <div className="banner-text">STANDARD MANUFACTURERS OF TISSUES</div>
        </div>
    );
}

export default Home;
